import 'bootstrap/dist/css/bootstrap.min.css';
import React from "react";
import InformationComponent from '../InformationComponent/InformationComponent';
import NavbarComponent from "../Navbar/NavbarComponent";
import NavbarSearchComponent from '../NavbarSearchComponent/NavbarSearchComponent';
import UserDetails from '../UserDetails/UserDetails';
import JobsList from '../JobsList/JobsList';
function CrackOffCampus(props) {

  { console.log(props) }
  return (
    <div className="CrackOffCampusComponent">
      <NavbarComponent/>
      <NavbarSearchComponent {...props.data} />
      <div className="flexBox_column">
        <UserDetails  {...props.userDetails} />
        <JobsList {...props.data}/>
        <InformationComponent {...props.information_announcement}/>
      </div>
    </div>
  )
}
export default CrackOffCampus;
